    "inputText": "Permian Gastroenterology Associates LLP\n315 E 5th Street, Odessa, TX 79761\nRavikumar P. Vemuru, M.D.\nSyam Vemulapalli, M.D.\nBoard certified in Gastroenterology and Internal medicine.\nPATIENT NAME:  XXXXXX\t\t\t\t        MRNO:\nDATE OF BIRTH:  XXXXXX\nDATE OF VISIT:  XXXXXX\nREFERRING PHYSICIAN:  Dr. Davison.\nCHIEF COMPLAINT:  Abdominal pain.\nHISTORY OF PRESENT ILLNESS:  The patient is a 56-year-old male who has been complaining of left upper quadrant abdominal pain for almost two years.  Symptoms are increased with food.  He also complains of chronic constipation problem.  He denies any nausea or vomiting.  The patient gives a history of chronic heartburn.  He also had one melanotic a week ago.  Denies any nausea or vomiting.  No history of any weight loss.  No history of any fever or chills.\nPAST MEDICAL HISTORY:  Unremarkable.\nSOCIAL HISTORY:  The patient admits to smoking.  Denies any alcohol.\nFAMILY HISTORY:  Negative for any GI malignancies.\nCURRENT MEDICATIONS:\nPrevacid.\nMEDICATION ALLERGIES:  NKDA.\nREVIEW OF SYSTEMS:\nGENERAL:  Denies any unusual weakness, fatigue, or fever.\nSKIN:  No rashes or skin lesions.\nHEENT:  Head:  Negative for history of head injury, headache, or dizziness.\nEYES:  No recent change in vision.  Denies blurring of vision or diplopia.\nEARS:  Negative for tinnitus, vertigo, or earaches.\nNOSE:  Negative for hay fever, nasal discharge, and nasal stuffiness.\nTHROAT:  Negative for sore throat or hoarseness.\nNECK:  No swollen glands, lumps, pain, or stiffness.\nRESPIRATORY:  Negative for cough, sputum production, hemoptysis, or shortness of breath.\nCARDIOVASCULAR:  No dyspnea, orthopnea, chest pain, or palpitations.\nGASTROINTESTINAL:  Appetite is good.  Negative for dysphagia, odynophagia, nausea, vomiting, indigestion, diarrhea, or constipation.  No abdominal pain.  Bowel movements are regular.  No hematochezia or melena.\n?\nXXXXXX\t\t\t\t\t\t\t\t\t   PAGE TWO\nXXXXXX\nGENITOURINARY:  No frequency, dysuria, hematuria, or urinary incontinence.\nPERIPHERAL VASCULAR:  No history of phlebitis or leg pain.  Negative for intermittent claudication.\nMUSCULOSKELETAL:  Denies arthralgia, injury, or swelling.  Denies any muscle stiffness, arthritis, gout, backache, or limitation of motion or activity.\nNEUROLOGICAL:  Positive for paresthesias.  No fainting, seizures, motor, or sensory loss.  Long-term and short-term memory is intact.  Denies frequent headaches, weakness of the extremities, or slurring of the speech.\nPSYCHIATRIC:  No history of depression or treatment for psychiatric disorders.\nPHYSICAL EXAMINATION:\nVital signs:  Blood pressure:  144/84 mmHg.  Pulse:  52.  Temperature:  97.\nGeneral:  The patient is in no acute distress.  Alert, awake, and comfortable.\nHEENT:  Head:  Normocephalic and atraumatic.  Hair of average textures.  Scalp without lesions.\nSkin:  No infections, jaundice, rash, or petechiae.\nEyes:  Conjunctiva moist and pink.  PERRLA.\nEars:  Auditory, acuity good to whispered voice.\nNose:  Mucosa is pink.  No sinus tenderness.  No nasal discharge.\nMouth:  Oral mucosa is moist and pink.  No gingivitis.\nNeck:  Supple.  Trachea is midline.  No thyromegaly.  No lymphadenopathy.  Carotid, no bruits.\nHeart:  S1 and S2 regular.  No S3 or S4.  No murmurs.  No jugular vein distention.\nThorax:  Symmetric with good excursion.\nLungs:  Clear.  No rales, wheezing, or rhonchi.\nAbdomen:  Positive for mild tenderness in the left upper quadrant.  No guarding or rebound is appreciated.  Soft and non-distended.  No masses.  No costovertebral angle tenderness.  Bowel sounds are active.\nPeripheral vascular:  Negative for ankle edema.  No stasis, pigmentation, or ulcers.  Radial pulses are 2+.  Dorsalis pedis 2+.\nMusculoskeletal:  No joint deformities.  Good range of motion.\nASSESSMENT:\nLeft upper quadrant pain with melanotic stools.  Peptic ulcer disease needs to be ruled out.\nColon cancer screening.\n?\nXXXXXX\t\t\t\t\t\t\t\t          PAGE THREE\nXXXXXX\nPLAN:\nWe will obtain a CBC.\nThe patient was advised regarding an upper endoscopy.  The procedure, risks, and benefits were discussed with the patient and the patient is agreeable for the procedure.\nThe patient was also advised regarding a screening colonoscopy which will be considered at his convenience.\nThank you Dr. Davison for allowing us to participate in the care of this patient.\n______________________\nSyam Vemulapalli, M.D.\nMak/hma\ncc:\tDr. Davison\nPhone: 432 333 3433\t\t\t\tFax: 432 333 3450\t\t\t\tEmail : Raviv @ aol.com\n",
